import {useState} from 'react'

export default function ItemGrid(){

    const [data, setData] = useState([{sellerTitle:"AMAZON", image: "https://m.media-amazon.com/images/I/61AALhMN3lL._AC_SY450_.jpg", itemTitle:"ZESTY PAWS", itemDesc:"THIS IS DESCRIPTION LOL"}])

